column17:
The following post uses a distract tactic:
@EzraFriedlander @ANCA_DC Ah here we are. I always look forward to hearing bs from Ezra Freeloader. Hey how was that dinner you had with Jake the Fake on Aliyev‚Äôs expense

This tweet is distracting from the main topic of discussion, which is the situation involving the Azerbaijani government and President Aliyev. Instead, it brings up a personal interaction between Ezra Friedlander and someone named Jake, which is irrelevant to the conversation at hand. This tactic aims to divert attention away from the main issue by focusing on a different, unrelated topic.

column15:
The only post that uses a Distort tactic is:

@knj_brasil @secawards marcos I vote #RM for #ArtistaAsiatico at #SECAwards + RT

This post adds the word "marcos" before the main message of voting for RM at the SECAwards, potentially leading to confusion or misinterpretation of the main message.
